import React, { useState, useEffect} from 'react';

import './styles.scss'

const Square = ({id}) => {
      // Оголошуємо нову змінну стану, яку назвемо "count"
  const [count, setCount] = useState(0);

  return (
    <div>
      <p>Ви натиснули {count} разів</p>
      <button onClick={() => setCount(count + 1)}>
        Натисни мене
      </button>
    </div>
  );
}

export default Square;
